static const uint8_t CourbB[] = {
    5,
    0x0F,0x90,0x33,0x2C,0x09
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadCourbData(char *Buffer)
{
    memcpy(Buffer, &CourbL0[1], CourbL0[0] << 2);
    Buffer += (CourbL0[0] << 2);

    memcpy(Buffer, &CourbL1[1], CourbL1[0] << 2);
    Buffer += (CourbL1[0] << 2);

    memcpy(Buffer, &CourbB[1], CourbB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char CourbName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillCourbData(void)
{
    remove(CourbName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteCourbData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(CourbName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, CourbName)) return "";
    #endif

    if (!(han = fopen(CourbName, "wb"))) return "";
    if (AutoClean) atexit(KillCourbData);

    num = fwrite(&CourbL0[1], 4, CourbL0[0], han);
    if (num != CourbL0[0]) {fclose(han); return "";}

    num = fwrite(&CourbL1[1], 4, CourbL1[0], han);
    if (num != CourbL1[0]) {fclose(han); return "";}

    num = fwrite(&CourbB[1], 1, CourbB[0], han);
    if (num != CourbB[0]) {fclose(han); return "";}

    fclose(han);
    return CourbName;
}

